import React from 'react';


const About = () =>{
    return (
        <div className="container">
            <div className="py-4" >
                <h1 className=" text-center py-4 text-info ">About/Help</h1>
                <div>
                    <p className="text-justify help text-light">Online restaurant reservation platforms primarily provide a platform that allows people to make online table reservations at their favorite restaurants in a seamless & hassle-free manner. Users can choose a restaurant based on location, timing, cuisine, and number of guests. Apart from this core marketplace feature, these restaurant booking websites maintain restaurant listing with ratings to help out diners in deciding the right dining outing as per their specific taste.
                      </p>
                      </div>  
            </div>
        </div>
    );
};

export default About;
